export default function App(props) {

    let users=[];
    for(let i = 0; i < props.length; i++){
        users.append([props[i].name, props[i].age, props[i].gen]);
    }
    
    return (
        <div>
            {users.map(user => <><h1>{user.name}</h1><h2>{user.age}</h2><h2>{user.gen}</h2></>)}
        </div>
    )
}
